import ReadBook from "./ReadBook";

export default function ReadList({ read, onDeleteRead, onSelectBook }) {
  return (
    <ul className="space-y-4">
      {read.map((book) => (
        <ReadBook
          book={book}
          key={book.id}
          onDeleteRead={onDeleteRead}
          onSelectBook={onSelectBook}
        />
      ))}
    </ul>
  );
}
